import React from 'react'

type useLoadVideosProps = {
  page_index: number;

}

declare var process : {
  env: {
    REACT_APP_REMITANO_BACKEND_URL: string
  }
}

const useLoadVideos = (page_index: useLoadVideosProps) => {
  fetch(`${process.env.REACT_APP_REMITANO_BACKEND_URL}/videos`)
    .then((response) => {
      console.log(response);
    })
  return null
}

export default useLoadVideos
